import React from "react";

const Table = props => {
  let tableBody;
  if (props.weather.length) {
    let tableRows = props.weather.map(weather => (
      <tr key={weather.id}>
        <td>{weather.weather_state_name}</td>
        <td>Fish</td>
      </tr>
    ));

    tableBody = <tbody>{tableRows}</tbody>;
  }

  return (
    <table>
      <thead>
        <tr>
          <th>Condition</th>
          <th>Day</th>
          <th>Location</th>
          <th>Humidity</th>
        </tr>
      </thead>
      {tableBody}
    </table>
  );
};

export default Table;
